import React from 'react';
import Nav from "./Nav"
import MobileNav from "./MobileNav"
import { useSelector } from "react-redux"

const Header = () => {
    const isLogged = useSelector(isLogged);
    return (
        <header>
            <div className="container">
                <p></p>
                <Nav/>
                <MobileNav/>
            </div>
        </header>
    );
}

export default Header;
